script: |
  super -f text -I q6104.spq | sort > q6104.out

inputs:
  - name: q6104.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 3 + + col2 BETWEEN ( - col0 + - col1 + ( 77 ) + - + 83 + col2 * col2 + col1 * - + col1 ) AND col2;
  - name: tab1

outputs:
  - name: q6104.out
    data: |
      51	14	96
      85	5	59
      91	47	68
